import React from 'react';
import Login from './components/LogIn/Login.jsx';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Register from './components/Register/Register.jsx';

function App() {
  return (
    <BrowserRouter>
      <Login />
      <div className="App">
        <Routes>
          <Route path="/" element={<Login />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
